import React, { Component } from 'react';
import Fade from 'react-reveal/Fade';

import QFDELOGO from '../../src/logo-qfde.png';

class HeroHome extends Component{
    render() {
        return (
        <>
        <Fade>
        <div className="md:pt-24 hero-home md:h-screen flex-col">
            <div className="container p-10 md:h-full px-3 mx-auto flex flex-col justify-center">
                <div className="flex flex-col justify-center text-center md:text-left w-full md:w-8/12">
                <div className="w-full flex justify-center">
                    <img className="w-3/4 mt-4 md:mt-0" src={QFDELOGO} />  
                </div>
                </div>
            </div>
        </div>
        </Fade>
        </>

        )
    }
}
export default HeroHome;
